export function TestModel() {
    var count = ref(0)

    function setCountDefaultValue(defaultValue) {
        count.value = defaultValue;
    }

    function incrementCount() {
        count.value++;
    }

    function reduceCount() {
        count.value--;
    }

    function doubleCount() {
        count.value *= 2;
    }

    function halfCount() {
        count.value /= 2;
    }

    return count;
}

export default {
    data() {
        return {
            count: 0
        };
    },
    methods: {
        setCountDefaultValue(defaultValue) {
            this.count = defaultValue;
        },
        incrementCount() {
            this.count++;
        },
        reduceCount() {
            this.count--;
        },
        doubleCount() {
            this.count *= 2;
        },
        halfCount() {
            this.count /= 2;
        },
    }
}
